    function LoginComponent(routes, config, http) {
        this.routes = routes;
        this.config = config;
        this.http = http;
        this.location = ["Shadnagar", "Yadagirigutta"];
        this.searchPlaceholder = "Enter a location or zipcode";
    }
    LoginComponent.prototype.updateResults = function (val) {
        this.location = ["Shadnagar", "Yadagirigutta"];
        this.location = this.location.filter(function (value) {
            return value.toLowerCase().trim().includes(val.toLowerCase().trim());
        });
    };
